import React, { Component } from 'react'

export default class Login extends Component {
  render() {
    return (
      <div className='container mt-4'>
        <form className='form-control'>
           <div className='m-3'>
            <label htmlFor="InputEmail" className='form-lable'> Email:</label>
            <input id='InputEmail' type="email" className='form-control mt-1' placeholder='exampel: email@componename.com' />

            <label htmlFor="InputPassword" className='form-lable'> Password:</label>
            <input id='InputPassword' type="password" className='form-control mt-1' placeholder='*****' />

            <button className='btn btn-primary mt-4' type='submit' >submit</button>
           </div>
        </form>
      </div>
    )
  }
}
